import Header from "../components/Header";
import Footer from "../components/Footer";
import LoginButton from "../components/LoginButton";
import { useEffect } from "react";
import useAuth from "../hooks/useAuth";
import axios from "axios";
import "./HomePage.css";

const Expired = () => {
  const { setAuth } = useAuth();

  const svgIcon = (
    <svgIcon>
      <img alt="circle_button" src="../icon_button.svg" />
    </svgIcon>
  );

  // logout if unauthorised (not the same as forbidden) as jwt has expired (or user is already logged out)
  useEffect(() => {
    setAuth({});

    axios
      .get("http://localhost:5500/oauth/logout")
      .then((response) => {
        console.log(response);
      })
      .catch((err) => {
        console.log(err);
      });
  }, [setAuth]);

  return (
    <main className="home-page">
      <img className="home-page-child" alt="" src="../ellipse-55.svg" />
      <img className="mask-group-icon" alt="" src="../mask-group@2x.png" />
      <img className="mask-group-icon1" alt="" src="../mask-group1@2x.png" />
      <img className="home-page-item" alt="" src="../ellipse-54.svg" />
      <img className="home-page-inner" alt="" src="../ellipse-56.svg" />
      <img className="mask-group-icon2" alt="" src="../mask-group2@2x.png" />
      <h1 className="advancing-next-generation">Session expired</h1>
      <Header />
      <div className="ucl-apps-portal">
        Your session has expired. Please login and try again.
      </div>

      <LoginButton />

      <Footer />
    </main>
  );
};

export default Expired;
